import React, { Component } from 'react'
import "./textkor.css";

export class IntroKor extends Component {
  render() {
    return (
        <div className='m-10'>
            <div className='text-xs font-light font-grotesk'>KOR</div>
            <div className='text-base'>서울에서 일하고 있는 디자이너입니다.</div>

        </div>
    )
  }
}

export default IntroKor
